import Card from '../card/Card';
import style from './cards.module.css';

export default function Cards({allVideogames}) {
   return (
      <div className={style.cards}>{
            allVideogames.map(({id,name,genres,image})=>{
                  return (
                     <div>
                        <Card
                           key={id} 
                           id={id}
                           name={name} 
                           genres={genres} 
                           image={image} 
                        />
                     </div>

                  )
               }
            )
         }
      </div>
   );
}
